import React from "react";
import InputField from "../../component/PublicComponent/InputField";

const Login = () => {
  return (
    <div className="px-main]">
      <div className="w-[400px] h-[500px] bg-gray-100">
        <InputField nameKey={''}></InputField>
      </div>
    </div>
  );
};

export default Login;
